import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../../assets/img/logo.png';

const Logo = () => {
  return (
    <div className="logo">
      <Link to="/">
        <img src={logo} alt="Bitrader" />
      </Link>
    </div>
  );
};

export default Logo;
